	.membership{width:100vw;height:100vh;top:0px;left:0px;position:fixed;z-index:999999999;padding:0px;overflow:hidden;display:flex;}
	.membership>*{width:100%;height:100%;flex-direction:row;display:flex;align-items:center;justify-content:space-between;padding:0px;}
	.membership-back{background:var(--card);color:var(--text);border-radius:50%;cursor:pointer;position:absolute;top:10px;left:10px;width:50px;height:50px;display:flex;align-items:center;justify-content:center;box-shadow:var(--box-shadow);font-size:20px;border:2px solid transparent;}
	.membership-back:hover{border-color:var(--main);color:var(--main);}
	.membership input{color:var(--text);padding: 15px 20px; width: calc(100% - 40px); border: 1px solid var(--grey); background: var(--menu);border-radius: 5px; outline: 0px; background: var(--sidebar);}
	.membership label{margin-top: 20px; margin-bottom: 10px; font-weight: 500; text-transform: none; color: var(--text); letter-spacing: 0.5px;}
	.membership-intro, .membership-billing{position:relative;display:flex;flex-direction:column;    justify-content:center;}
	.membership-intro{flex:none;width:40%;background:var(--bg-gradient);height:100vh;color:var(--white);display:flex;flex-direction:column;align-items:center;justify-content:center;flex:none;}
	.membership-args, .membership-story{height:50%;justify-content:center;width:80%;display:inline;}
	.membership-billing{width:60%;height:100%;    background: var(--card);padding: 0px;display: flex; justify-content:center; align-items: center;flex:none;}
	.membership-billing> *{width:80%;}
	.membership h2{margin-top:0px;    font-size: 40px; font-weight: 500; width: 100%; text-align: left; display: flex; justify-content: flex-start; align-items: center;}
	.membership-billing > *{width:80%;}
	.membership-story{z-index:2;font-size:11px;color:var(--grey);}
	.membership h3{font-size:20px;color:var(--white);}
	.membership-args{flex:none;z-index:2;display:flex;flex-direction:column;font-weight:500;font-size:14px;}
	.membership-arg{flex:none;margin:3px 0px;color:var(--white);}
	.membership-arg.disabled{opacity:0.3;}
	.membership-arg i{width:30px;height:30px;background:var(--main);color:var(--white);display:inline-flex;align-items:center;justify-content:center;margin-right:10px;border-radius:30px;}
	.membership-form{display:flex;align-items:center;justify-content:center;flex-direction:column;}
	.membership-form > *{width:100%;}
	.membership-input-list{display:flex;flex-direction:column;}
	.membership-footer{width:100%;display:flex;flex-direction:column;align-items:center;justify-content:center;}
	.membership-legalese{font-size:12px;margin-top:20px;}
	.membership-btn{background:var(--main);width:100%;}
	.membership-billing-options:before{content: "Billing";}
	.membership-billing-options{display:flex;align-items:center;justify-content:flex-start;}
	.membership-billing-options > *{box-shadow:var(--box-shadow);padding:5px 10px;font-weight:500;font-size:14px;margin:5px;cursor:pointer;}
	.membership-billing-options > *.active{background:var(--primary);color:var(--white);pointer-events:none;}
	.membership-main-btn{flex-direction:row;text-align:center;background:var(--main);flex:none; background:var(--main-gradient);color: var(--white); display: flex; justify-content: center; font-size:14px;padding:15px 30px; height:50px; font-weight:400;}
	.membership-form .membership-main-btn{margin-top:30px;width:100%;}
	.membership-main-btn i{font-size:20px;margin-right:12px;}
	.membership-main-btn:hover{background:var(--main-hover);}
	.membership-already-member{width:100%;text-align:center;margin-top:10px;font-size: 12px;}
	.membership-already-member-link{margin-left:5px;cursor:pointer;color:var(--main);}
	.membership-already-member-link:hover{color:var(--main-hover);}
	.membership-profile-details{border-radius:10px;box-shadow:var(--box-shadow);background:var(--card); cursor:pointer;padding:0px;width:auto;height:40px;position:relative;border:2px solid transparent;display:flex;align-items:center;justify-content:center;}
	.membership-profile-details img{margin-left:10px;margin-right:10px;width:30px;height:30px;box-shadow:var(--box-shadow);border-radius: 5px;}
	.membership-profile-details-email{font-size:12px;max-width:150px;overflow:hidden;text-overflow:ellipsis;border:1px solid transparent;}
	.membership-profile-details:after{content: "\e928";  font-family:"Feather";margin-left:5px;margin-right:5px;}
	.membership-label-row{display:flex;align-items:center;justify-content:space-between;}
	.membership-label-row > *{max-width:48%;}
	.membership-label-row input{margin-top:10px;}
	.membership-identities{display:flex;align-items:center;justify-content:flex-start;font-size:12px;}
	.membership-identity{cursor:pointer;padding:5px 10px;display:flex;align-items:center;justify-content:center;margin-right:5px;color:var(--grey);background:var(--backdrop);border:1px solid transparent;border-radius:20px;}
	.membership-identity:hover{color:var(--main);border-color:var(--main);background:var(--backdrop);}
	.membership-identity img{margin-right:5px;border-radius:50%;width:24px;height:24px;flex:none;}
	.membership-app-logo{display:flex;align-items:center;justify-content:flex-start;font-size:12px;margin-bottom:10px;}
	.membership-secondary-nav{    position: absolute; right: 20px;  top: 10px; width: fit-content; z-index: 8888; }
	.membership-app-logo img{margin-right:5px;width:25px;height:25px;flex:none;}
	.membership-large-emoji{    font-size: 80px;  display: flex; align-items: center; justify-content: center; margin-bottom: 30px;}
	.membership-contribution{color:var(--main);margin-top:10px;}
	.membership-free-disclaimer{box-shadow:var(--box-shadow);width:100%;font-size:12px;margin-top:10px;}
	.membership-free-disclaimer > div{padding:20px;}
	.membership-contribution-options{display:flex;align-items:center;flex-wrap:wrap;}
	.membership-contribution-option{cursor:pointer;border: 1px solid var(--grey);display:flex;align-items:center;justify-content:center;background:var(--sidebar); padding: 5px 10px; border-radius: 20px; margin: 5px; font-size: 12px;}
	.membership-contribution-option:not(.active):hover{border-color:var(--main);color:var(--main);}
	.membership-contribution-radio{border: 1px solid var(--grey);width:13px;height:13px;margin-right:5px;display:flex;align-items:center;justify-content:center;border-radius:50%;background:var(--white);cursor:pointer;}
	.membership-contribution-option.active{pointer-events:none;    color: var(--white); background: var(--main-gradient);}
	.membership-contribution-option.active .membership-contribution-radio{border-color:var(--main);}
	.membership-contribution-option.active .membership-contribution-radio:after, .membership-contribution-option:hover .membership-contribution-radio:after{content:"";width:7px;height:7px;background:var(--main);border-radius:50%;}
	@media (min-width:992px){
		.membership-large-emoji{display:none;}
		.membership-profile-details:hover{border-color:var(--main);color:var(--main);}
		.membership-profile-details:hover:after{color:var(--main);}
		.membership-args-mobile{display:none;}
		.membership-billing> *{max-width:500px;}
		.dark .membership{background:var(--card);}
		.dark .membership-billing{background: var(--black);}
		.dark .membership-intro{background:#1a1a1f;}
		
		.membership h2{   white-space: pre-wrap;}
	}
	@media (max-width:991px){

		.membership{flex-direction:column;overflow:auto;background:var(--card);height: calc(var(--vh, 1vh) * 100);}
		.dark .membership-intro{background:transparent;margin-top:20px;}
		.membership-billing, .membership-intro{width:100%;}
		.dark .membership-billing{ background:transparent;}
		.membership-profile-details{ width:23px;height:23px;margin-right:-7px;}
		.membership-profile-details:after{display:none;}
		.membership-profile-details-email{display:none;}
		.membership-profile-details img{margin-right:0px;margin-left:0px;width:23px;height:23px;}
		.membership-intro{   height:auto;padding-top:0px;padding-bottom:50px;margin-bottom:40px;}
		.membership-app-logo{display:none;}
		.membership-args{display:none;}
		.membership-secondary-nav{ position: fixed;  top: 7px; right: 20px; color: var(--white) !important;}
		.membership-secondary-nav > * > *:first-child{display:none;}
		.membership-intro .membership-already-member-link{color:var(--white);font-size:10px;}
		.membership-args-mobile{font-size:14px;width:100%;padding:10px 0px;z-index: 9999;display:flex;justify-content:flex-start;align-items:center;flex-direction:column;}
		.membership-args-mobile .membership-arg{width:80%;color:var(--text);margin-top:10px;margin-bottom:10px;}
		.membership-form{display:none;}
		.membership-args-mobile .membership-main-btn{width:80%;margin-top:10px;margin-bottom:20px;}
		.membership-args-mobile.hide{display:none;}
		.membership h2{    position: absolute;  top: 0px; width: 100% !important; left: 0px; text-align: center; font-size: 12px; justify-content: center; height: 50px; background: var(--main-gradient); color:var(--white);}
		.membership.form-mode .membership-args-mobile, .membership.form-mode .membership-intro{display:none;}
		.membership-billing{padding-top: 70px;
    padding-bottom: 30px;flex:none;height:auto;}
		.membership.form-mode .membership-form{display:flex;}
		.membership-back{margin-top:-3px;width: 30px;height: 30px;font-size:14px;box-shadow:none;background:transparent;color:var(--white);}
		.membership-intro{background:transparent;}
		.membership-story{padding-bottom: 100px;flex:none;}
		.membership-story, .membership-story *:not(a){color:var(--text) !important;}
		.membership-identity{background:transparent; box-shadow:var(--box-shadow);}
		.membership-graphic{height:200px;flex:none;margin-bottom:20px;    filter: hue-rotate(140deg);}
		.membership-back:hover{ color:var(--white);border-color:var(--white);}
	}
